import React from "react";
import Jumbotron from '../Jumbotron';
import '../CreatePolicy';

export default function PolicyPage() {
    return (
        <div>
            <Jumbotron 
            title="Policies" 
            description="Propose your own policies." />
            <div className="ui form">
                <div className="ui right labeled input">
                    <input>XD</input>
                </div>
            </div>
        </div>
    );
}
